    data: |
      SELECT ALL - - ( col2 ) * - + 49 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN + col1 - + ( - col0 ) + - col2 AND NULL;
  - name: tab1

outputs:
  - name: q10586.out
    data: |
